<p class=heading-3>JSE_GETFILENAMELIST (off)</p>
<p class=heading-3-p>&nbsp;</p>
<p class=senormalpara>If your application does not need to use the <span class=secodephrase>SE_FILENAMES</span> object, you can turn it off and save the code and runtime space associated with storing these filenames.</p>
